sage should be displayed 'Your Order Has Been Cancelled'\n\n  @returnOrder @regression\n  Scenario: Verify User can Return the order\n    And User click on Orders section\n    And User click on first order in list\n    And User click on Return Items button\n    And User select the Return Reason 'Item damaged'\n    And User select the drop off service 'FedEx'\n    And User click on Return Order button\n    Then a return message should be displayed 'Return was successfull'\n\n  @reviewOnOrder @regression\n  Scenario: Verify User can write a review on order placed\n    And User click on Orders section\n    And User click on first order in list\n    And User click on Review button\n    And User write Review headline 'Good Quality Product' and 'I strongly recommend this item'\n    And User click Add your Review button\n    Then a review message should be displayed 'Your review was added successfully'\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailOrder.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@regression","id":"581f0e66-c8d6-419d-bc04-d27791ce7576"}],"language":"en","keyword":"Feature","name":"Retail Order","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"2f337c96-4534-4ef6-a762-c4f4730ce43d"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"87c9b68f-add7-40c8-a7d7-fe5225a57ff3"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'jackphar1@tekschool.us' and password 'Tek@12345'","id":"62880f16-fba0-43b9-9f66-e735644a8268"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button
